import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int n = scanner.nextInt();
        int k = scanner.nextInt();
        int[] a = new int[n];
        for (int i = 0; i < n; i++) {
            a[i] = scanner.nextInt();
        }
        int sum = 0;
        for (int i = 0; i < n; i++) {
            sum += a[i];
        }
        if (sum < k) {
            System.out.println("First");
        } else {
            int turn = 0;
            int stones = k;
            for (int i = 0; i < n; i++) {
                if (a[i] <= stones) {
                    stones -= a[i];
                    turn++;
                }
            }
            if (turn % 2 == 0) {
                System.out.println("Second");
            } else {
                System.out.println("First");
            }
        }
    }
}
